function GetClosestToCuror()
    MousePos = GetMouse()
    Closest = math.huge
    Target = nil
    for v, u in pairs(game:GetService("Workspace").BossFolder:GetChildren()) do
        if u:FindFirstChild("Head") then
            Point, OnScreen = workspace.CurrentCamera:WorldToViewportPoint(u.Head.Position)
            if OnScreen and NotObstructing(u.Head.Position, {game.Players.LocalPlayer.Character, u.Head}) then
                Distance = (Vector2.new(Point.X, Point.Y) - MousePos).magnitude
                if Distance <= AimBot.FOV then
                    Closest = Distance
                    Target = u
                end
            end
        end
    end
    for v, u in pairs(game:GetService("Workspace").enemies:GetChildren()) do
        if u:FindFirstChild("Head") then
            Point, OnScreen = workspace.CurrentCamera:WorldToViewportPoint(u.Head.Position)
            if OnScreen and NotObstructing(u.Head.Position, {game.Players.LocalPlayer.Character, u.Head}) then
                Distance = (Vector2.new(Point.X, Point.Y) - MousePos).magnitude
                if Distance <= AimBot.FOV then
                    Closest = Distance
                    Target = u
                end
            end
        end
    end
    return Target
end
